var divPlayPause, divJumpToStart, divTempo, txtTempo, divSteps, txtSteps, divLoopPosition;

var channelArr = []
var instrumentArr = [];
var divStepArr = [];
var sequenceArr = [];
var volumeSliderArr = [];
var muteBtnArr = [];
var soloBtnArr = [];
var divViewBarArr = [];

var playerState = 'paused';
var instrumentChannels = 16;

var currentStep    =  1;
var totalSteps     = 16;

var currentMeasure =  1;
var totalMeasures  =  1;

var beatLength     =  4;
var measureLength  = 16;
var beatsPerMeasure = (measureLength / beatLength);

var lastStep = totalSteps;
var sequencerTimer;
var sequencerTimeoutLength;
var currentInstrument;
var tempoSlider;
var stepsSlider;
var soloCount = 0;

